{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Transience\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Transience is a plugin for enhancing or reducing transients. It works by using two envelopes. One is an envelope follower (short attack, longer decay; roughly follows the peaks of the sound), the other is a user specified envelope (with attack/decay). You can then shape the sound according to the difference between the two, making attacks or decays longer or shorter. The plugin operates in logarithmic space. {\field{\*\fldinst{HYPERLINK "https://i.imgur.com/TgC7n2B.png"}}{\fldrslt{\ul
Screenshot
}}}
\par}
}

