{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Satan Verb\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Satan verb is a reverberation unit mostly meant for diffuse and gated style reverberation. It can either be used without an envelope, to generate large ambient spaces, or be modulated by an envelope based on the input sound to give a sound more body while not adding too much noise to the dead time. {\field{\*\fldinst{HYPERLINK "https://i.imgur.com/JLXFrOH.png"}}{\fldrslt{\ul
Screenshot 1
}}}
, {\field{\*\fldinst{HYPERLINK "https://i.imgur.com/EclxtWp.gif"}}{\fldrslt{\ul
