{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Swellotron\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Swellotron computes the spectrum of both signals (using the STFT), multiplies the magnitudes in the spectral domain and puts the result of that in an energy buffer. This energy buffer is drained proportionally to its contents. The energy buffer is then used to resynthesize the sound, but this time with a random phase. In plain terms, it behaves almost like a reverb, where frequencies that both sounds have in common are emphasized and frequencies where the sounds differ are attenuated. This will almost always lead to something that sounds pretty harmonic. {\field{\*\fldinst{HYPERLINK "https://i.imgur.com/ikizwwk.gif"}}{\fldrslt{\ul
Screenshot
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs28 Demos\par}
{\pard \ql \f0 \sa180 \li0 \fi0 You can find demos of the plugin {\field{\*\fldinst{HYPERLINK "https://www.youtube.com/watch?v=PSaL8BvYdKk"}}{\fldrslt{\ul
here
}}}
 and {\field{\*\fldinst{HYPERLINK "https://www.youtube.com/watch?v=Ggojmb9wd5U"}}{\fldrslt{\ul
here
}}}
.\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs28 Features:\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab FFT Reverberation\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Shimmer: Copies energy to twice the frequency (leading to iterative octave doubling).\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Aether: Same as shimmer but for fifths.\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Scorch: Input saturation.\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Ruin: Output saturation.\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Diffusion: Spectral blur.\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Ice: Chops small bandwidth bits from the energy at random, and copies them to a higher frequency (at 1x or 2x the frequency), thereby giving narrowband high frequency sounds (sounding very cold).\sa180\par}
